function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          dineshkumar.B
        </p>
        <dashboard></dashboard>

        </header>
        <p>qe</p>

 </div>
  );
}

export default App;
